  \"2013-03-15T16:59:52.661799\",\n\t\"name\": \"2000-census-tracts-for-arizona\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of the polygonal
  boundaries for the 2000 Census Tracts for Arizona. Census tracts are small, relatively
  permanent statistical subdivisions of a county delineated by local participants
  as part of the U.S. Census Bureau's Participant Statistical Areas Program. The U.S.
  Census Bureau delineated census tracts in situations where no local participant
  existed or where local or tribal governments declined to participate. The primary
  purpose of census tracts is to provide a stable set of geographic units for the
  presentation of decennial census data. Census tracts generally have between 1,500
  and 8,000 people, with an optimum size of 4,000 people. (Counties with fewer people
  have a single census tract.) When first delineated, census tracts are designed to
  be homogeneous with respect to population characteristics, economic status, and
  living conditions. The spatial size of census tracts varies widely depending on
  the density of settlement. Census tract boundaries are delineated with the intention
  of being maintained over many decades so that statistical comparisons can be made
  from decennial census to decennial census. However, physical changes in street patterns
  caused by highway construction, new developments, and so forth, may require occasional
  boundary revisions. In addition, census tracts occasionally are split due to population
  growth or combined as a result of substantial population decline. Census tracts
  are identified by a four-digit basic number and may have a two-digit numeric suffix;
  for example, 6059.02. The decimal point separating the four-digit basic tract number
  from the two-digit suffix is shown in the printed reports and on census maps. In
  computer-readable files, the decimal point is implied.\",\n\t\"license_title\":
